import React from 'react';
import '../../App.css';

export default function Tokens() {
  return  <p className='tokens'>Akash loves rini with all of his heart,life. He has put in all of his feelings and emotions into her that now he can't see/love anything but her.
  He is willing to shed all of his blood and sweat to keep her loved and happy always. She must know the significance and respect she has in his perspective which
  is not subject to change. Thougths of rini loving him back are the only things that charm him in his despair. If she ever finds him in despair, all she needs
  to do is show him some love and everything will be fine. 
  Akash does not have a heavy pocket to give financially expensive presents, nor does he have a very attractive look to make the couple look publicly attractive,
  but he does love rini with everything he has/can manage. So she should never refuse
  whatever he does for her by spending sweat,love,little finance and if required blood also.
  All rini needs to do is show him some of her love and he shall come out of all of his despairs and make her life more happy and loved.<br></br>
  Akash Loves Rini and so does rini.<br></br> RINI get him a lovable nickname please. </p>;

}
